import React from 'react';
import {MDBBtn, MDBIcon} from "mdbreact";

const Esti = () => {
    return (
        <div>
            <h1>이사 견적 보기</h1>

            <MDBIcon icon="truck" size={"10x"} />
            <MDBIcon icon="home" size={"10x"} />
            <MDBIcon icon="building" size={"10x"}/>
            <MDBIcon icon="gift" size={"10x"} />
        </div>
    );
};

export default Esti;
